import { configureStore } from "@reduxjs/toolkit";
import user from "./reducers/user.slice";
import auth from "./reducers/auth.slice";
import gamesPlayed from "./reducers/gamePlayed.slice";

export const store = configureStore({
  reducer: {
    user,
    auth,
    gamesPlayed,
  },
});
